// src/components/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Dashboard.css';

function Dashboard() {
  return (
    <div className="dashboard-container">
      <h2 className="dashboard-title">Dashboard</h2>
      <div className="dashboard-options">
        <Link to="/network-scanner" className="dashboard-option">
          <h3>7/24 Network Scan</h3>
          <p>Initiate and monitor network scans around the clock.</p>
        </Link>
        <Link to="/network-detector" className="dashboard-option">
          <h3>7/24 Network Detector</h3>
          <p>View and analyze network logs efficiently.</p>
        </Link>
        <Link to="/honeypotpage" className="dashboard-option">
          <h3>Honeypot </h3>
          <p>Creating a honeypot for securing your network.</p>
        </Link>
      </div>
    </div>
  );
}

export default Dashboard;
